import './App.css';

function HomePage() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="brain.png" alt="logo" />

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
        </a>
      </header>
    </div>
  );
}

export default HomePage;
